import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    avatar: {
      height: 75,
      width: 75,
    },

    control: {
      padding: theme.spacing(2),
    },
  }));

  
export default function Notes() {
    const classes = useStyles();
    const elements = ['one', 'two', 'three'];
    const items = []

    for (const [index, value] of elements.entries()) {
        items.push(
            <Grid>
                <Grid item xs={5} justify="center" align="center">
                    <Avatar src="https://upload.wikimedia.org/wikipedia/fr/4/4f/RSC_Anderlecht_logo.png" className={classes.avatar}/>
                </Grid>
                <Grid align="center" item xs={6}>
                    <Typography variant="h2">0</Typography>
                </Grid>
            </Grid>
            )
    }
  return (
        <Grid container spacing={3} xs={3}>
            <Grid item xs={5} justify="center"
            align="center">
                <Avatar src="https://upload.wikimedia.org/wikipedia/fr/4/4f/RSC_Anderlecht_logo.png" className={classes.avatar}/>
            </Grid>
            <Grid align="center" item xs={6}>
                <Typography variant="h2">0</Typography>
            </Grid>
            <Grid align="center" item xs={5}>
                <Avatar src="https://upload.wikimedia.org/wikipedia/fr/4/4f/RSC_Anderlecht_logo.png" className={classes.avatar}/>
            </Grid>
            <Grid align="center" item xs={6}>
                <Typography variant="h2">0</Typography>
            </Grid>
            <Grid align="center" item xs={12}>
                <Typography>90'</Typography>
            </Grid>
            <Grid style={{height: "50px"}} xs={12}>

            </Grid>
            {items}
        </Grid>
        
      
  )
}
